import { unpackZipDataUri } from './src/utils/interactiveZip.js';

const data = 'data:application/zip;base64,';
const res = await unpackZipDataUri(data);
console.log('ok', res.ok, 'error', res.error);
console.log('indexUrl starts', res.indexUrl?.slice(0, 60));
console.log('urls size', res.urls?.size);
if (res.urls) {
  let i = 0;
  for (const [key, value] of res.urls.entries()) {
    console.log(key, value.slice(0, 60));
    if (++i >= 5) break;
  }
}
